import React, { useState, useEffect } from 'react';
import axios from 'axios';
import index from 'axios/index';


// console.log(process.env.REACT_APP_YOUTUBE_API_KEY)
// https://youtube.googleapis.com/youtube/v3/channels?part=snippet%2CcontentDetails%2Cstatistics&id=UCu2YhywZvs7pXUEL3RCUEaA&key=[YOUR_API_KEY]
// Channel ID = UCu2YhywZvs7pXUEL3RCUEaA


const App = () => {

  const [videos, setVideos] = useState([]);
  const [videoFilter, setVideoFilter] = useState('');

  const handleChange = (event) => {
    console.log(event.target.value)
    setVideoFilter(event.target.value)
  }

  useEffect(() => {
    axios
      .get(index)
      .then(response => {
        console.log('promise fulfilled')
        setVideos(response.data)
      })
  }, [])
  console.log('render', videos.length, 'videos')


  return (
    <div>
      <input value={videoFilter} onChange={handleChange} />

      <ul>
        {videos.map(video =>
          <li key={video.id}>
            {video.id}
          </li>
          )}
      </ul>

    </div>
  )
}

export default App;
